contracts/InterestRateModel.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

contract InterestRateModel {
    uint256 public baseRate;  // Base interest rate (e.g., 2%)
    uint256 public multiplier; // Additional rate per utilization (e.g., 10%)

    constructor(uint256 _baseRate, uint256 _multiplier) {
        baseRate = _baseRate;
        multiplier = _multiplier;
    }

    function getBorrowRate(uint256 totalLiquidity, uint256 totalBorrows) external view returns (uint256) {
        if (totalLiquidity == 0) return baseRate;

        uint256 utilizationRate = (totalBorrows * 1e18) / totalLiquidity;
        return baseRate + ((utilizationRate * multiplier) / 1e18);
    }
}

